import React, {Component} from 'react';
import Form from '../form/Form';
import Section from './Section';
// import ZoomLine from './charts/ZoomLine/ZoomLine';
import ZoomScatter from './charts/ZoomScatter/ZoomScatter';

// import climateChange from './../images/climate-change.jpg';
import airPollution from '../../images/air-pollution.jpg';
import deforestation from '../../images/deforestation.jpg';
import coolingTower from '../../images/cooling-tower.jpg';

class Main extends Component {
    render() {
        return (
            <main className="site-main">
                <h2>Global Warming</h2>
                {/*<img src={climateChange} alt="Topic Climate Change" />*/}

                <br/>
                <br/>
                <br/>
                <ZoomScatter />

                {/*<div id="zoomline"></div>*/}

                <Section id="causes" contentH3="Air Pollution" content="Lorem ipsum dolor sit amet, consectetur adipisicing elit. Ducimus laudantium animi maiores totam minus sed itaque tempora deleniti, dolore quis necessitatibus earum eveniet, asperiores suscipit maxime doloremque ipsa." imgScr={airPollution} />

                <Section id="effects" contentH3="Deforestation" content="Lorem ipsum dolor sit amet, consectetur adipisicing elit. Ducimus laudantium animi maiores totam minus sed itaque tempora deleniti, dolore quis necessitatibus earum eveniet, asperiores suscipit maxime doloremque ipsa." imgScr={deforestation} />

                <Section id="solutions" contentH3="Cooling Tower" content="Lorem ipsum dolor sit amet, consectetur adipisicing elit. Ducimus laudantium animi maiores totam minus sed itaque tempora deleniti, dolore quis necessitatibus earum eveniet, asperiores suscipit maxime doloremque ipsa." imgScr={coolingTower} />

                <h2 id="contact">Contact Us</h2>
                <Form />
            </main>
        );
    }
}

export default Main
